import {useState} from "react"


let detailsData = [];

let handleClick =  async (input, props) => {
    try {
      let res = await fetch("http://localhost:3001/details", {
        method: "POST",
        headers: {'Content-Type': 'application/json'},
        body: JSON.stringify({input}), 
      });
    detailsData = await res.json()
     
    } catch (err) {
      
    }

  }
function Details(props) {

  if(detailsData !== prevState.detailsData){
    props.setDetails(detailsData)
}   

   
  return (props.dataDetails === "") ? "" : (
    <div> 
      <p>Vardas {props.dataDetails.fname}</p>
      <p>Pavarde {props.dataDetails.lname}</p>
      <p>AK {props.dataDetails.ak}</p> 
      <p>Email {props.dataDetails.email}</p>
      <p>Amzius {props.dataDetails.age}</p>
    </div>
  )
}

export default Details
export {handleClick};
